script: |
  super -f text -I q3545.spq | sort > q3545.out

inputs:
  - name: q3545.spq
    data: |
      SELECT DISTINCT + 7 / 37 / 3 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN CAST ( + + col0 AS INTEGER ) - - + col0 * - + 7 AND + - 33;
  - name: tab2

outputs:
  - name: q3545.out
    data: |
